INSERT INTO `prodotti` (`id`, `nome`, `descrizione`, `dettaglio`, `categoria`, `immagine`, `prezzo`) VALUES
(1, 'KIT GARA KAPPA REPLICA 2022/23', 'Vestirsi come i grandi campioni per vivere una passione infinita già dai primi anni. Il completo kids composto da maglia, pantaloncini e calzettoni coordinati si ispira alla nuova divisa Home 2023/24. La maglia Home del Bari per la stagione 23/24 unisce stile iconico e tecnologie innovative. Ispirata alle divise in bianco e rosso del passato, questa maglia rimane fedele al DNA del club. Lo stemma della squadra ricamato e i dettagli completano il look.', 'Tessuto: I pantaloncini sono realizzati in un tessuto di alta qualità, composto da una miscela di poliestere e spandex. Questa combinazione offre comfort, elasticità e traspirabilità ottimali durante l\'attività sportiva.', 'kit ufficiale', 'data:image/jpeg;base64,', 69.99);
INSERT INTO `prodotti` (`id`, `nome`, `descrizione`, `dettaglio`, `categoria`, `immagine`, `prezzo`) VALUES
(2, 'MAGLIETTA MANICHE CORTE', 'Maglietta a maniche corte, fascia colorata sul davanti e sulle maniche. Logo Omini e SSC BARI sul petto e sulle maniche. 100% poliestere - SLIM FIT', 'Maglietta a maniche corte, fascia colorata sul davanti e sulle maniche. Logo Omini e SSC BARI sul petto e sulle maniche. 100% poliestere - SLIM FIT', 'magliette', 'data:image/jpeg;base64,', 30);
