INSERT INTO `prodotti` (`id`, `nome`, `descrizione`, `dettaglio`, `categoria`, `immagine`, `prezzo`) VALUES
(5, 'FELPA TECNICA KAPPA', 'Felpa a maniche lunghe con mezza zip e fascia colorata sul davanti. Logo Omini sulle maniche e SSC BARI sul petto e sulle maniche.', '100% poliestere - SLIM FIT', 'felpe', 'data:image/jpeg;base64,', 49);
INSERT INTO `prodotti` (`id`, `nome`, `descrizione`, `dettaglio`, `categoria`, `immagine`, `prezzo`) VALUES
(6, 'BORSONE KAPPA', 'In corredo alla borsa, verrà spedito il relativo Fondo Rigido/Vano portascarpe. Borsa Revolution Big ideata per trasportare il necessario per lo sport, con un grande scomparto rigido e separato per le scarpe. Il grande scomparto rigido della borsa permette di isolare le scarpe dopo gli allenamenti e le partite. Caratteristiche: Tracolla regolabile; Tasca frontale; Loghi ricamati sul lato; Apertura superiore a doppio cursore; Zip n°10 sul vano scarpiera con doppio cursore; 5 piedini in gomma sul fondo; Ampie superfici personalizzabili', 'Dimensioni: Altezza: 55cm – Larghezza: 52cm – Profondità: 35cm - 100% poliestere 600D', 'accessori', 'data:image/jpeg;base64,', 50);
INSERT INTO `prodotti` (`id`, `nome`, `descrizione`, `dettaglio`, `categoria`, `immagine`, `prezzo`) VALUES
(7, 'CALZE AGGS GRIPSOCKS BIANCO', 'Le calze Aggs sono caratterizzate da una tecnologia avanzata studiata per migliorare la tua performance. Una volta indossate ti accorgerai di come il calzino ti avvolga e ti faccia sentire subito sicuro. Sulla pianta del piede sono stati posizionati dei pentagoni di silicone che durante lo svolgimento dell’attività ti aiutano ad avere una maggiore aderenza e un maggior controllo del tuo movimento. Altro vantaggio fondamentale è che grazie all’aderenza che ti dà la calza i cambi di movimento saranno molto più precisi e sicuri. ', 'Le calze Aggs Gripsocks sono le prime sul mercato senza cotone nei materiali. Sì, Infatti sono composte da 96% poliammide e 4% elastomero, il che rende la calza molto elastica con un effetto seconda pelle', 'calze', 'data:image/jpeg;base64,', 30);
INSERT INTO `prodotti` (`id`, `nome`, `descrizione`, `dettaglio`, `categoria`, `immagine`, `prezzo`) VALUES
(8, 'CALZE AGGS GRIPSOCKS ROSSO', 'Le calze Aggs sono caratterizzate da una tecnologia avanzata studiata per migliorare la tua performance. Una volta indossate ti accorgerai di come il calzino ti avvolga e ti faccia sentire subito sicuro. Sulla pianta del piede sono stati posizionati dei pentagoni di silicone che durante lo svolgimento dell’attività ti aiutano ad avere una maggiore aderenza e un maggior controllo del tuo movimento. Altro vantaggio fondamentale è che grazie all’aderenza che ti dà la calza i cambi di movimento saranno molto più precisi e sicuri.', 'Le calze Aggs Gripsocks sono le prime sul mercato senza cotone nei materiali. Sì, Infatti sono composte da 96% poliammide e 4% elastomero, il che rende la calza molto elastica con un effetto seconda pelle', 'calze', 'data:image/jpeg;base64,', 30);
INSERT INTO `prodotti` (`id`, `nome`, `descrizione`, `dettaglio`, `categoria`, `immagine`, `prezzo`) VALUES
(9, 'CALZE AGGS GRIPSOCKS NERO', 'Le calze Aggs sono caratterizzate da una tecnologia avanzata studiata per migliorare la tua performance. Una volta indossate ti accorgerai di come il calzino ti avvolga e ti faccia sentire subito sicuro. Sulla pianta del piede sono stati posizionati dei pentagoni di silicone che durante lo svolgimento dell’attività ti aiutano ad avere una maggiore aderenza e un maggior controllo del tuo movimento. Altro vantaggio fondamentale è che grazie all’aderenza che ti dà la calza i cambi di movimento saranno molto più precisi e sicuri.', 'Le calze Aggs Gripsocks sono le prime sul mercato senza cotone nei materiali. Sì, Infatti sono composte da 96% poliammide e 4% elastomero, il che rende la calza molto elastica con un effetto seconda pelle', 'calze', 'data:image/jpeg;base64,', 30);
INSERT INTO `prodotti` (`id`, `nome`, `descrizione`, `dettaglio`, `categoria`, `immagine`, `prezzo`) VALUES
(10, 'ZAINO KAPPA', 'Lo zaino Velia della collezione sportiva Kappa ti accompagnerà in tutti i tuoi spostamenti. Grazie ai suoi scomparti, è così comoda quanto estetica: troviamo una tasca laterale dove mettere la bottiglia, mentre il fondo in PVC impermeabile lo rende un prodotto molto resistente.', 'Zaino in tessuto navetta. Dimensioni in taglia M: 31cm x 20cm x 41cm. Cinghie tracolla regolabili imbottite, compartimento principale con chiusura zip, tasca frontale con zip e tasca laterale in mesh.', 'accessori', 'data:image/jpeg;base64,', 35);
